pragma solidity >=0.6.0 <0.9.0;

contract EventModuleCore {

/* important hash is used to store IPFS payload model can be developed futher */
    struct EventModule {
        address owner;
        string protocol;
        address protocolContractAddress;
        string _hash;
        Channel[] channels;
    }

    struct Channel {
        address owner;
        string _hash;
        User[] subscriber;
    }

    struct User {
        address userAddress;
        string _hash;
        bool isSubsribed;
    }

    mapping(bytes32 => EventModule) private eventModule;
    mapping(address => User) private users;
    mapping(bytes32 => Channel) private channels;

    // Modifiers to be added with User Role/Permissions

// Events
    event EventModuleCreated(address owner, bytes32 uuid, string protocol, address contractAddress, uint256 timestamp, string filehash);
    event EventModuleUpdated(address owner, uint256 timestamp, string filehash);
    event EventModuleDisabled(address owner, uint256 timestamp, string filehash);
    event ChannelCreated(address owner, bytes32 uuid, uint256 timestamp, string filehash);
    event ChannelUpdated(address owner, uint256 timestamp, string filehash);
    event ChannelDisabled(address owner, uint256 timestamp, string filehash);

    event SubscribedToChannel(address owner, bytes32 channelUUID, uint256 timestamp);
    event UnubscribedChannel(address owner, bytes32 channelUUID, uint256 timestamp);

    function createEventModule(bytes32 uuid, string memory protocol, address protocolAddress, string memory _newHash) public {
       // can be developed further with modifiers (duplicate check)
        if (eventModule[uuid].owner == msg.sender) {
            revert("module exists");
        }
        eventModule[uuid].owner = msg.sender;
        eventModule[uuid].protocol = protocol;
        eventModule[uuid].protocolContractAddress = protocolAddress;
        eventModule[uuid]._hash = _newHash;
        emit EventModuleCreated(msg.sender, uuid, protocol, protocolAddress, block.timestamp, _newHash);
    }

    function updateEventModule() public {
        // pending
    }

    function getEventModule(bytes32 uuid) public view returns (string memory, bytes32[] memory) {
        // pending
    }

    function disableEventModule() public {
        // pending
    }

    function createChannel(bytes32 uuid, string memory _newHash) public {
       // can be developed further with modifiers (duplicate check)
        if (channels[uuid].owner == msg.sender) {
            revert("channel exists");
        }
        channels[uuid].owner = msg.sender;
        channels[uuid]._hash = _newHash;
        emit ChannelCreated(msg.sender, uuid, block.timestamp, _newHash);
    }

    function getChannel(bytes32 uuid) public view returns (string memory, bytes32[] memory) {
        // pending
    }

    function updateChannel() public{
        // pending
    }

    function disableChannel() public {
       // pending
    }

    function addChannelToModule(bytes32 moduleUUID, bytes32 channelUUID) public {
        if(eventModule[moduleUUID].owner != msg.sender) {
            revert('not allowed');
        }
          if(channels[moduleUUID].owner != msg.sender) {
            revert('not allowed');
        }
        eventModule[moduleUUID].channels.push(channels[channelUUID]);
    }

    function subscribedToChannel(bytes32 channelUUID, string memory _newHash) public{
       User memory user = User(msg.sender, _newHash, true);
       channels[channelUUID].subscriber.push(user);
       emit SubscribedToChannel(msg.sender, channelUUID, block.timestamp);
    }

     function unSubscribeChannel(bytes32 channelUUID) public{
         // to be done
         emit UnubscribedChannel(msg.sender, channelUUID, block.timestamp);
    }

}
